//React19
import { useActionState } from "react";

async function increment(previousState:number): Promise<number> {
  return previousState + 1;
}

async function decrement(previousState:number): Promise<number> {
  return previousState - 1;
}

async function reset(previousState:number): Promise<number> {
    return previousState =0;
}

function ObjectName() {
    return<label>相手キャラ: <input type="text" placeholder="これがプレースホルダー"/></label>
}

function CountRate({ rate }: { rate: number }) {
    return <div>WinRate: {rate.toFixed(2)}</div>;
}

function declimentAction(prevState,formData){
    return decrement(prevState);
}
export function Counter() {
  const [stateWin, formAction] = useActionState(increment, 0);
  const [stateLose, formAction2] = useActionState(increment, 0);
const rate = stateWin + stateLose > 0 ? stateWin / (stateWin + stateLose) : 0;
  return (

    <form>
    <ObjectName/>
      Win:{stateWin}
      <button formAction={formAction}>stateWinIncrement</button>
      Lose:{stateLose}
      <button formAction={formAction2}>stateLoseIncrement</button>
      All Game:{stateWin + stateLose}
    <CountRate rate={rate}/>
    </form>
  )
}
